import React, { useState } from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/styles';
import {
  Modal,
  Card,
  CardContent,
  CardActions,
  Grid,
  Typography,
  TextField,
  Switch,
  Button,
  colors
} from '@material-ui/core';

const useStyles = makeStyles(theme => ({
  root: {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    outline: 'none',
    boxShadow: theme.shadows[20],
    width: 700,
    maxHeight: '100%',
    overflowY: 'auto',
    maxWidth: '100%'
  },
  container: {
    marginTop: theme.spacing(3)
  },
  actions: {
    justifyContent: 'flex-end'
  },
  saveButton: {
    color: theme.palette.white,
    backgroundColor: colors.green[600],
    '&:hover': {
      backgroundColor: colors.green[900]
    }
  }
}));

const AddServices = props => {
  const { open, onClose, visit, className, ...rest } = props;

  const classes = useStyles();


  const selectedVisits = {
    visitNumber: visit.visitNumber,
    visitName: visit.visitName,

  }

  console.log('OPEN MODAL visit',selectedVisits)



  const [formState, setFormState] = useState({...selectedVisits});

  console.log('OPEN MODAL formState',formState)



  if (!open) {
    return null;
  }

  const handleFieldChange = event => {
    event.persist();
    setFormState(formState => ({
      ...formState,
      [event.target.name]:
        event.target.type === 'checkbox'
          ? event.target.checked
          : event.target.value
    }));
  };


  return (

    <Modal
      onClose={onClose}
      open={open}
    >

      <Card
        {...rest}
        className={clsx(classes.root, className)}
      >
        <form>
          <CardContent>
            <Typography
              align="center"
              gutterBottom
              variant="h3"
            >
             Client Visits
            </Typography>
            <Grid
              className={classes.container}
              container
              spacing={3}
            >
              <Grid
                item
                md={12}
                xs={12}
              >
                <TextField
                  fullWidth
                  read
                  label="Visit Number"
                  name="visitNumber"
                  onChange={handleFieldChange}
                  value={selectedVisits.visitNumber}
                  variant="outlined"
                />
              </Grid>
              <Grid
                item
                md={12}
                xs={12}
              >
                <TextField
                  fullWidth
                  label="Visit Date"
                  name="visitName"
                  onChange={handleFieldChange}
                  value={selectedVisits.visitName}
                  variant="outlined"
                />
              </Grid>
              <Grid
                item
                md={12}
                xs={12}
              >
                <TextField
                  fullWidth
                  label="Visit Type"
                  name="description"
                  onChange={handleFieldChange}
                  value={formState.description}
                  variant="outlined"
                />
              </Grid>
              <Grid
                item
                md={12}
                xs={12}
              >
                <TextField
                  fullWidth
                  label="Service Offfred"
                  name="phone_number"
                  onChange={handleFieldChange}
                  value={formState.phone_number}
                  variant="outlined"
                />
              </Grid>
              <Grid
                item
                md={12}
                xs={12}
              >
                <TextField
                  fullWidth
                  label="Next Phone Call Date"
                  name="phone_number"
                  onChange={handleFieldChange}
                  value={formState.phone_number}
                  variant="outlined"
                />
              </Grid>
              <Grid
                item
                md={12}
                xs={12}
              >
                <TextField
                  fullWidth
                  label="Next Physical Visit Date"
                  name="phone_number"
                  onChange={handleFieldChange}
                  value={formState.phone_number}
                  variant="outlined"
                />
              </Grid>


              <Grid
                item
                md={6}
                xs={12}
              >
                <Typography variant="h5">Consent</Typography>
                <Typography variant="body2">
                  The client consented to draw blood samples
                </Typography>
                <Switch
                  checked={formState.discountedPrices}
                  color="secondary"
                  edge="start"
                  name="discountedPrices"
                  onChange={handleFieldChange}
                  value={formState.discountedPrices}
                />
              </Grid>
            </Grid>
          </CardContent>
          <CardActions className={classes.actions}>
            <Button
              onClick={onClose}
              variant="contained"
            >
              Close
            </Button>
            <Button
              className={classes.saveButton}
              onClick={onClose}
              variant="contained"
            >
              Save
            </Button>
          </CardActions>
        </form>
      </Card>
    </Modal>
  );
};

AddServices.displayName = 'Add Services';

AddServices.propTypes = {
  className: PropTypes.string,
  //customer: PropTypes.any,
  onClose: PropTypes.func,
  open: PropTypes.bool
};

AddServices.defaultProps = {
  open: false,
  onClose: () => {}
};

export default AddServices;
